# Analiza el HTML
soup = BeautifulSoup(html, "html.parser")

# Crea un nuevo archivo de Excel y hoja
workbook = openpyxl.Workbook()
sheet = workbook.active

# Configura el ancho de las columnas
columns = ["A", "B", "C", "D", "E", "F", "G", "H", "I", "J", "K"]
column_widths = [20, 20, 20, 20, 20, 20, 20, 20, 20, 20, 20]

for col, width in zip(columns, column_widths):
    sheet.column_dimensions[col].width = width

# Itera a través de las filas y celdas en el HTML y copia los valores en el archivo de Excel
for tr in soup.find_all("tr"):
    row = []
    for td in tr.find_all(["th", "td"]):
        row.append(td.get_text())
    sheet.append(row)

# Aplica estilo a las celdas
for row in sheet.iter_rows(min_row=1, max_row=3):
    for cell in row:
        cell.alignment = Alignment(wrapText=True)

# Guarda el archivo de Excel
workbook.save("tabla_excel_con_separaciones.xlsx")
